// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;
contract Carauction{
    event Auction(address owner , address highestBidder , uint HighestBidder );

    struct auction{
        address highestBidder; 
        uint  HighestBidder; 
        uint auctionStart;
        uint  auctionEnd;

    }

    auction[] mostexpensive;
    address public  highestBidder;
     constructor() public {
     highestBidder = msg.sender;
     }
     
    
    function themost(address _highestBidder , uint  _HighestBidder , uint _auctionStart , uint  _auctionEnd) public  payable {
     mostexpensive.push(auction({highestBidder : _highestBidder ,HighestBidder : _HighestBidder ,auctionStart : _auctionStart , auctionEnd : _auctionEnd}));
      
    }
    
}

